import React from 'react';





var Hello = React.createClass({
  render: function() {
    var infowindow = new window.google.maps.InfoWindow({
      content: contentString
    });
    var contentString = "world";
    return <div>Hello, { infowindow }!</div>;
  }
});

export default InfoWindow;
